import React from 'react';

const Story = ({ story, index }) => {
  return (
    <div>
      <div>{index + 1}. {story.title}</div>
      <div>
        {story.score} points by {story.by} | 
        {new Date(story.time * 1000).toLocaleTimeString()} ago | 
        {story.descendants} comments
      </div>
    </div>
  );
};

export default Story;
